import "./Navbar.css";

export default function Navbar() {
  return (
    <header className="nav">
      <div className="nav-inner container">
        <a href="/" className="logo">
          <img src="/img/logo-panda.png" alt="판다마켓 로고" />
          <span>판다마켓</span>
        </a>
        <nav className="menu">
          <a href="/market">마켓</a>
          <a href="/faq">FAQ</a>
          <a href="/login" className="login-btn">로그인</a>
        </nav>
      </div>
    </header>
  );
}
